function Invoke-Snaffler {
    [CmdletBinding()]
    param(
        [Parameter(Mandatory=$true)]
        [string[]]$ExeArgs
    )

    # ====== EMBEDDED BASE64 PAYLOAD ======
    [string]$b64 = @"

"@

    # ====== DECODE & LOAD ======
    [byte[]]$peBytes = [Convert]::FromBase64String($b64.Trim())
    $asm = [System.Reflection.Assembly]::Load($peBytes)

    # ====== INVOKE ENTRY POINT ======
    $ep = $asm.EntryPoint
    if (-not $ep) {
        Throw "No entry point found in the assembly."
    }

    # Figure out how many parameters Main expects
    $paramCount = $ep.GetParameters().Length

    if ($paramCount -eq 0) {
        # Parameterless Main
        $ep.Invoke($null, $null) | Out-Null
    }
    else {
        # Wrap your string[] into an object[] so Invoke sees a single argument
        $invokeArgs = ,$ExeArgs
        $ep.Invoke($null, $invokeArgs) | Out-Null
    }
}

